import './Expenses.css';

function ExpenseItem(props) {

    return (
        <div className="expense-item">
            <div>
                <div>{props.expense.date.toLocaleString().getMonth}</div>
                <div>{props.expense.date.FullYear}</div>
                <div>{props.expense.date.getDate}</div>
            </div>
            <div>{props.expense.date}</div>
            <div className="expense-item__description">
                <h2>{props.expense.title}</h2>
                <h2>{props.date}</h2>
                <div className="expense-item_price">${props.expense.amount}</div>
            </div>
        </div>
    )
}

